import React from "react";
import "./style.css";

function Footer() {
  return (
    <div className="footer p-2 fixed-buttom">
      <div className="row">
        <div className="col-lg text-center">
          <h1 className="display-4">Footer</h1>
        </div>
      </div>
    </div>
  );
}

export default Footer;
